DROP PROCEDURE IF EXISTS `SP_Batch_ProcessWatsonData`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Batch_ProcessWatsonData`(ExecutionDate DateTime)
BEGIN

	START TRANSACTION;

	/*Select * from watsondata_dump_temp;*/
	
	/*Insert Bug State and Bug Status in statestatus table*/
		BugState, 
		BugStatus,
		AddedBy,
		AddedOn
	) 
	SELECT DISTINCT 
					dump.BugState, 
					dump.BugStatus,
					'BATCH',
					NOW()
	FROM watsondata_dump_temp dump
	Where NOT Exists 
				(	Select 1 From watsonbugsstatus stat
					WHERE stat.BugState = dump.BugState 
					AND stat.BugStatus = dump.BugStatus
					);

	/*Select * from watsonbugsstatus;*/

	/*Adding statestatus ID into dump TABLE......*/
	UPDATE 	watsondata_dump_temp dump, 
					watsonbugsstatus stat
	SET 
		dump.BugStatusID = stat.WatsonBugsStatusID,
		dump.UpdatedBy = 'BATCH',
		dump.UpdatedOn = NOW()
	Where dump.BugState = stat.BugState 
	AND dump.BugStatus = stat.BugStatus;

	/*Insert Product and Versions into productversion table*/
		Product,
		Version,
		AddedBy,
		AddedOn
	)
	SELECT DISTINCT 
		Product, 
		Version,
		'BATCH',
		NOW()
	FROM watsondata_dump_temp dump 
	Where NOT Exists 
				(Select 1 From watsonproductdetails pd 
					WHERE pd.Product = dump.Product 
					AND pd.Version = dump.Version
				);

	UPDATE 	watsonproductdetails pd, 
					Products p, 
					ProductVersions pv
	SET 
		pd.ProductVersionID = PV.ProductVersionID,
		pd.UpdatedBy = 'BATCH',
		pd.UpdatedOn = NOW()
	WHERE p.Product = pd.Product
	AND pv.ProductID = p.ProductID
	AND pv.ProductVersion =  pd.Version
	AND pd.ProductVersionID is NULL;

	/*Adding ProductVersionID in dump TABLE...*/
	UPDATE 	watsondata_dump_temp dump, 
					watsonproductdetails pd 
	SET 
		dump.ProductDetailID = pd.watsonproductdetailID,
		pd.LastExecutionDate = ExecutionDate,
		pd.UpdatedBy = 'BATCH',
		pd.UpdatedOn = NOW()
	WHERE dump.Product = pd.Product 
	AND dump.Version = pd.Version;

	/*Select * from watsondata_dump_temp;*/

	/*Insert Bug Ownwer in users table to keep a list of all active users.*/
		BugOwner,
		AddedBy,
		AddedOn
	) 
	SELECT DISTINCT 
		dump.BugOwner,
		'BATCH',
		NOW()
	FROM watsondata_dump_temp dump 
	Where NOT Exists 
				(Select 1 From watsonusers U 
					WHERE U.BugOwner = dump.BugOwner
				) 
	AND dump.BugOwner IS NOT NULL;

	/*Adding USERID in dump table*/
	UPDATE 	watsondata_dump_temp dump, 
					watsonusers U 
	SET 
		dump.WatsonUserID = U.WatsonUserID
	WHERE dump.BugOwner IS NOT NULL 
	AND 	dump.BugOwner = U.BugOwner;

	/*Updating TypeID in dump table*/
	UPDATE 	watsondata_dump_temp dump
	SET dump.TypeID = IF(dump.Type='ALL', 0, IF(dump.Type='CORE', 1, 2));

	DELETE FROM watsondata
	WHERE Date(ExtractedDate) = Date(ExecutionDate)
	AND productdetailID In (Select ProductDetailID from watsondata_dump_temp);

	DELETE FROM watsondata_daily 	
	WHERE Date(ExtractedDate) = Date(ExecutionDate)
	AND productdetailID In (Select ProductDetailID from watsondata_dump_temp);
	
	/*Dump all data into watsondata*/
		ExtractedDate,
		TypeID,
		ProductDetailID,
		BugStatusID,
		WatsonUserID,
		BugCount,
		AddedBy,
		AddedOn
	)
	Select Distinct
		ExecutionDate,
		TypeID,
		ProductDetailID,
		BugStatusID,
		WatsonUserID,
		BugCount,
		'BATCH',
		NOW()
	From watsondata_dump_temp dump;

	/*Dump all data into watsondata*/
		ExtractedDate,
		TypeID,
		ProductDetailID,
		BugStatusID,
		BugCount,
		AddedBy,
		AddedOn
	)
	Select 
		ExecutionDate,
		TypeID,
		ProductDetailID,
		BugStatusID,
		SUM(BugCount),
		'BATCH',
		NOW()
	From watsondata_dump_temp dump
	Group By 	ExecutionDate,
						TypeID,
						ProductDetailID,
						BugStatusID;

	DELETE FROM watsondata_dump_temp;

	SELECT 0;
	COMMIT;
END
;;
DELIMITER ;
