INSERT INTO `projectwindup` VALUES ('4', '27', '- GO URLs not created for all locales\r\n- Delayed Patch posting impacted our LOC verification of Manifest files.', '', '', 'SAURAGUP', '2012-12-19 19:14:54', 'SAURAGUP', '2012-12-19 19:16:12');
INSERT INTO `projectwindup` VALUES ('5', '26', '- GO URLS not created for all locales\r\n- Manifest file verification delayed due to late patch posting on test server', '', '', 'SAURAGUP', '2012-12-19 19:17:00', 'SAURAGUP', '2012-12-19 19:17:41');
INSERT INTO `projectwindup` VALUES ('6', '30', '', '', '', 'SAURAGUP', '2013-01-31 03:07:00', 'SAURAGUP', '2013-01-31 03:07:03');
INSERT INTO `projectwindup` VALUES ('7', '29', '', '', '', 'SAURAGUP', '2013-01-31 03:07:30', null, null);
INSERT INTO `projectwindup` VALUES ('8', '24', '- Higher Planning and coordination effort due to sprint model. Worked for Testing teams as more planned and distributed testing.\r\n- Test cases quality is good. Requires Added/Updated test cases for areas like Document Profile, Splash and About screens.\r\n- Testing Partners to provide value additions by creating test cases and Workflows. Invite them for Demos\r\n- Automated process to generate the LOC Binaries\r\n- Have the Automation available on all locales\r\n- Installer: Test cases quality requires improvement\r\n\r\n', '- Reduce Wrong translation Bugs\r\n- Good to start content compilation early to have a better coverage', '- Functional and Linguistic Testing done in each sprint. Sanity testing at time of Release.\r\n- GKITs consolidations -  For n branches, we send only 1 GKIT, resulting in reduced cost, and effort.\r\n- Provided context to Linguists at time of translations to reduce bugs at later stage.\r\n- Shortcut/Hotkey testing is done with regular testing cycles.\r\n- JER (Japanese Expert Review) for new features (done by native users).\r\n- Done post mortem at end of each sprint and share information with Testing teams where immediate action required.\r\n', 'SAURAGUP', '2013-05-09 21:16:07', 'SAURAGUP', '2013-07-29 22:13:54');
