INSERT INTO `screenlabels` VALUES ('288', 'G11N', '10', '<font style=\"color: Red\">Globalization</font> (G11N) refers to a broad range of engineering and business development processes necessary to prepare and launch products and company activities globally. The globalization engineering activities are composed of internationalization and localization  while the business development activities focus on product management, financial, marketing and legal aspects.\r\n', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('289', 'I18N', '10', '<font style=\"color: Red\">Internationalization</font> (commonly abbreviated as I18n) is an engineering exercise focused on generalizing a product so that it can handle multiple languages, scripts and cultural conventions (currency, sorting rules, number and dates formats…) without the need for redesign. Internationalization, sometimes referred to as world-readiness, can be divided into two sets of activities: enablement and localizability.\r\n', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('290', 'IE', '10', '<font style=\"color: Red\">International Engineering Team</font> works towards the Localization and Internationalization of Adobe\'s products through high-quality, timely and cost-effective deliverables.', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('291', 'IPM', '10', '<font style=\"color: Red\">International Program Manager</font> bridges the gap between different Adobe Teams, Pre-release and QE Partners to release the product in International markets.', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('292', 'IQE', '10', '<font style=\"color: Red\">International Quality Engineering Team</font> works towards certifying the Adobe Product for Functional and Linguistic Testing.', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('293', 'L10N', '10', '<font style=\"color: Red\">Localization</font> (L10N) is the process of adapting a product or service to a particular language, culture, and desired local “look-and-feel”. Translating the product’s user interface is just one step of the localization process. Resizing dialogs, buttons and palette tabs to accommodate longer translated strings is also part of localization.', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('294', 'Message', '10', 'You are logged out successfully.', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('295', 'T9N', '10', '<font style=\"color: Red\">Translation</font> (T9N) is simply converting the meaning of text in one language into another. In a software product, the content that are translated are user interface, documentation, packaging and marketing collaterals. Most translation work is done by professionals, although in recent years, some companies started exploring the use of ‘community’-translation, and machine-translation.\r\n', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('296', 'Terms', '5', 'Common Terminologies', null, null, null, null);
INSERT INTO `screenlabels` VALUES ('297', 'World-Readiness ', '10', '<font style=\"color: Red\">World-Readiness</font> is an equivalent term to Globalization, but it’s more often used in the context of internationalization.', null, null, null, null);
